import React from "react";
import { Link } from "react-router-dom";
import { RiUserAddFill } from "react-icons/ri";
import { IoLogIn } from "react-icons/io5";
import { BsCart4 } from "react-icons/bs";
export const Header = () => {
  return (
    <div className="w-full flex justify-between items-center p-5 bg-indigo-50 shadow-xl">
      <Link to={"/"}>
        <div className="logo">
          <span className="text-black-200 text-2xl font-bold flex justify-start items-center">
            BookManagementSystem
          </span>
        </div>
      </Link>
      <div className="nav-items flex">
        <span className="text-xl cursor-pointer text-grey-200 font-bold m-3 hover: underline hover:text-indigo-200">
          <RiUserAddFill />
        </span>
        <span className="text-xl cursor-pointer text-grey-200 font-bold m-3 hover: underline hover:text-indigo-200">
          <IoLogIn />
        </span>
        <span className="text-xl cursor-pointer text-grey-200 font-bold m-3 hover: underline hover:text-indigo-200">
          <RiUserAddFill />
        </span>
      </div>
    </div>
  );
};
